%[text] ## Bubbles
%[text] ### Load
close all hidden
clearvars
mmSetUnitDataFolder(3) % set unit 3 data folder %[output:8d750d75]
load("bubbles.mat","Vol")
%%
%[text] ### Render
volumeViewer(Vol)
%%
mmSliceView(Mask) %[output:7cb218e3]
%%
%[text] ### Segment Bubbles
medVol = medfilt3(Vol); % apply median filter
Mask = imbinarize(medVol); % threshold using default settings
volshow(Mask,RenderingStyle="Isosurface")
%%
hvr = viewer3d(parent=uifigure,BackgroundColor="white",BackgroundGradient="off",CameraZoom=1); % set background color to white and turn off gradient
volshow(Mask,parent= hvr,RenderingStyle="Isosurface",Colormap=hot) % display total segmentation as slice planes
%%
%[text] ### Clean up mask
Mask = imfill(Mask,"holes");
Mask = imclearborder(Mask);
volshow(Mask,RenderingStyle="Isosurface")


%%
%[text] ### Separate touching bubbles
waterMask = mmGetWatershed(Mask,[3 1]); % apply watershed transformation
%%
%[text] ### Visualize separation
% Create Label Maps
[maskL, countMask] = bwlabeln(Mask); % create label map from mask
[waterL, countWater] = bwlabeln(waterMask); % create label map from watershed mask
%%
% figure with grid layout
fig = uifigure(Name="Watershed Transformation",WindowStyle="normal"); % create figure to hold viewers
g = uigridlayout(fig,[1 2],Padding=[0 0 0 0]); % like tiledlayout, but for uifigures. 1x2 tiles

% render the before transform volume
hvr1 = viewer3d(parent=g, ... % add to first grid
    BackgroundColor="white", ... % white background
    BackgroundGradient="off", ... % no gradient
    CameraZoom=1, ...
    Title=sprintf("Before transform - %d",countMask)); % set background color to white and turn off gradient
volshow(maskL, ... % volume before transform
    Parent=hvr1, ... % display in first viewer3D
    Colormap=colorcube, ... % random colors
    RenderingStyle="CinematicRendering")

% render the after transform volume
hvr2 = viewer3d(parent=g, ... % add to second grid
    BackgroundColor="white", ... % white background
    BackgroundGradient="off", ... % no gradient
    CameraZoom=1, ...
    Title=sprintf("After transform - %d",countWater));
volshow(waterL, ... % volume after transform
    Parent=hvr2, ... % display in second viewer3D
    Colormap=colorcube, ... % random colors
    RenderingStyle="CinematicRendering")

linkviewers([hvr1 hvr2])

%%
rp = regionprops3(waterMask) %[output:2a19e141]
%%
mean(rp.Volume)
%%
rp = regionprops3(Mask,"Volume")
%%
mean(rp.Volume) %[output:3266f314]
%%
figure; %[output:4419968c]
histogram(rp.Volume,20) %[output:4419968c]
%%
la = rp.Volume < 1.6e4; % only volumes below cut-off
figure; %[output:46ca79bd]
histogram(rp.Volume(la)) %[output:46ca79bd]
xlabel("Volume (vox^3)") %[output:46ca79bd]
set(gca,"FontSize",18) %[output:46ca79bd]
%%
figure; %[output:0b0b2f57]
mmBoxSwarm([],rp.Volume) %[output:0b0b2f57]
%%
figure;
raincloudplot(rp.Volume)
%%

%%
volumeViewer(L)
%%
rp = regionprops3(Mask,"Volume")
%%
Mask = imboundary
%%
hvwr = volshow(Mask)
%%
figure;
histogram(Vol)
%%

%%
%[text] You Need MatGeom and Utilities added to the path
clearvars
%[output:936ad91b]
%%
%[text] ### Create and Save Bubbles
Vol = createBubbles;

volshow(Vol);
%%
save('bubbles.mat',"Vol","-mat")
