%[text] ## 3D shapes
%[text] ### Load
clearvars
mmSetUnitDataFolder(3) %[output:438aa880]

close all hidden
load('shapes3D.mat','Vol'); % 3D volume
%%
%[text] ### Get Volume dimensions and class
size(Vol) %[output:7e7a71ab]
class(Vol) %[output:6fd521e2]
%[text] 
%%
%[text] ### Volume Render
volumeViewer(Vol)
%[text] - scrub mouse over shapes to review intensity values \
%%
mmSetFigPublication %[output:89cc766f]
%%
figure; %[output:823196ae]
imhist(Vol) %[output:823196ae]

%%
vals = unique(Vol(:)) % unique values %[output:23ff43d4]
%%
%[text] ### Region properties
rp = regionprops3(logical(Vol), Vol,["Volume" "Centroid" "BoundingBox" "MaxIntensity"]) %[output:15251630]
%%
volshow(Mask) %[output:0e8871b9]
%%
Mask = Vol == 64; % create mask
volshow(Mask) %[output:0d167a00]
%%
Mask = Vol > 128; % create mask %[output:4f7fbda1]
volshow(Mask) %[output:52413ded]
%%
Mask = logical(Vol);
volshow(Mask)
%%
rp = regionprops3(Mask) %[output:0eb461d9]
%%
volCat = categorical(Vol,[64 128 192 250],["Sphere" "Diamond" "Cube" "Cylinder"]);
rp = regionprops3(volCat,Vol,["Volume" "Centroid" "MaxIntensity"]) %[output:58d0537c]
%%
%[text] ### 
MaskSphere = volCat == "Sphere"; %[output:15762301]
vs = volshow(MaskSphere)
%%
gcf.WindowStyle = "normal" %[output:26749544]
%%
%[text] ## Create and Save Shape
%[text] Function for creating shapes is at bottom of script
Vol = createShape;
volshow(Vol);
%[text] This create a volume with four embedded shapes of differing intensities
%%
mmSetUnitDataFolder(3)
save('shapes3D.mat',"Vol",'-mat') %[output:2d741aab] %[output:28f9b5e0] %[output:6229dd0a] %[output:6e684126] %[output:7cf68755] %[output:05d15d57] %[output:0c3d0ab2] %[output:48813a6a] %[output:6d9fe2fe] %[output:1d551aee] %[output:43c3e7ae] %[output:01171bad] %[output:374074e5]
